import React from 'react'

const Navbar = () => {
  return (
    <div className='xl:px-32 flex justify-between'>
      <h1 className='text-5xl text-white'>Visa Stocks Analysis</h1>
      <div>
        <Link to='/' className='text-2xl'>Dashboard</Link>
        <Link to='/predictions' className='text-2xl'>Predictions</Link>
      </div>
    </div>
  )
}

export default Navbar
